import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import New from './pages/New';
import Diary from './pages/Diary';
import Edit from './pages/Edit';

//components
import MyButton from './components/MyButton';
import MyHeader from './components/MyHeader';

function App() {
  return (
    <BrowserRouter>
      <div className='App'>
        <MyHeader
          headText={'app'}
          leftChild={<MyButton text={'left button'} onClick={() => alert('button clicked')} />}
          rightChild={<MyButton text={'left button'} onClick={() => alert('button clicked')} />}
        />
        <h2>App.js</h2>

        <MyButton text={'Button'} onClick={() => alert('Button Clicked')} type={'positive'} />
        <MyButton text={'Button'} onClick={() => alert('Button Clicked')} type={'negative'} />
        <MyButton text={'Button'} onClick={() => alert('Button Clicked')} />

        {/* <img src={process.env.PUBLIC_URL + '/assets/muscles.png'} style={{ width: 150 }}></img>
        <img src={process.env.PUBLIC_URL + '/assets/healthy.png'} style={{ width: 150 }}></img>
        <img src={process.env.PUBLIC_URL + '/assets/weight.png'} style={{ width: 150 }}></img>
        <img src={process.env.PUBLIC_URL + '/assets/weakness.png'} style={{ width: 150 }}></img>
        <img src={process.env.PUBLIC_URL + '/assets/belly.png'} style={{ width: 150 }}></img> */}
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/new' element={<New />} />
          <Route path='/diary/:id' element={<Diary />} />
          <Route path='/edit' element={<Edit />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
